function myMenuFunction() {
  var e = document.getElementById("myNavMenu");
  "nav-menu" === e.className
    ? (e.className += " responsive")
    : (e.className = "nav-menu");
}
function headerShadow() {
  let e = document.getElementById("header");
  document.body.scrollTop > 50 || document.documentElement.scrollTop > 50
    ? ((e.style.boxShadow = "0 1px 6px rgba(0, 0, 0, 0.1)"),
      (e.style.height = "70px"),
      (e.style.lineHeight = "70px"))
    : ((e.style.boxShadow = "none"),
      (e.style.height = "90px"),
      (e.style.lineHeight = "90px"));
}
window.onscroll = function () {
  headerShadow();
};
var typingEffect = new Typed(".typedText", {
  strings: ["Java Developer", "Spring Boot Dev", "Angular Developer"],
  loop: !0,
  typeSpeed: 100,
  backSpeed: 80,
  backDelay: 2e3,
});
const sr = ScrollReveal({
  origin: "top",
  distance: "80px",
  duration: 2e3,
  reset: !0,
});
sr.reveal(".featured-text-card", {}),
  sr.reveal(".featured-name", { delay: 100 }),
  sr.reveal(".featured-text-info", { delay: 200 }),
  sr.reveal(".featured-text-btn", { delay: 200 }),
  sr.reveal(".social_icons", { delay: 200 }),
  sr.reveal(".featured-image", { delay: 300 }),
  sr.reveal(".project-box", { interval: 200 }),
  sr.reveal(".top-header", {});
const srLeft = ScrollReveal({
  origin: "left",
  distance: "80px",
  duration: 2e3,
  reset: !0,
});
srLeft.reveal(".about-info", { delay: 100 }),
  srLeft.reveal(".contact-info", { delay: 100 });
const srRight = ScrollReveal({
  origin: "right",
  distance: "80px",
  duration: 2e3,
  reset: !0,
});
srRight.reveal(".skills-box", { delay: 100 }),
  srRight.reveal(".form-control", { delay: 100 });
const sections = document.querySelectorAll("section[id]");
function scrollActive() {
  let e = window.scrollY;
  sections.forEach((t) => {
    let i = t.offsetHeight,
      a = t.offsetTop - 50,
      n = t.getAttribute("id");
    e > a && e <= a + i
      ? document
          .querySelector(".nav-menu a[href*=" + n + "]")
          .classList.add("active-link")
      : document
          .querySelector(".nav-menu a[href*=" + n + "]")
          .classList.remove("active-link");
  });
}

